public class Solution {
    public int MinimumTime(IList<int> nums1, IList<int> nums2, int x) {
        long sum = 0;
        foreach (var num in nums1) {
            sum += num;
        }
        if (sum <= x) return 0;

        int n = nums1.Count;
        long[] prefix = new long[n+1];
        for (int i = 0; i < n; i++) {
            prefix[i+1] = prefix[i] + nums2[i];
        }

        long minTime = long.MaxValue;
        sum = 0;
        for (int i = 0; i < n; i++) {
            sum += nums1[i];
            long left = x - (sum - nums1[i]);
            int low = 0, high = i;
            while (low <= high) {
                int mid = (low + high) / 2;
                if (prefix[i+1] - prefix[mid] <= left) {
                    minTime = Math.Min(minTime, i - mid + 1L);
                    high = mid - 1;
                } else {
                    low = mid + 1;
                }
            }
        }

        return minTime == long.MaxValue ? -1 : (int)minTime;
    }
}
